import * as React from 'react'
import Apartments from "../../datas/Apartments.json"

function Carrousel (){


return (
    <div>
   {Apartments.map((Apart, index) => (
          <Card
            key={`${Apart.title}-${index}`}
            label={Apart.picture}
            title={Apart.title}
          />
          ))}  
    </div>
)
}

export default Carrousel
